        public class Mergesort<T> where T : IComparable
        {
            public static async Task Merge(T[] input, int left, int middle, int right)
            {
                T[] leftArray = new T[middle - left + 1];
                T[] rightArray = new T[right - middle];

                Array.Copy(input, left, leftArray, 0, middle - left + 1);
                Array.Copy(input, middle + 1, rightArray, 0, right - middle);

                int i = 0;
                int j = 0;

                for (int k = left; k < right + 1; k++)
                {
                    if (i == leftArray.Length)
                    {
                        input[k] = rightArray[j];
                        j++;
                    }
                    else if (j == rightArray.Length)
                    {
                        input[k] = leftArray[i];
                        i++;
                    }
                    else if (IsLess(leftArray[i], rightArray[j]))
                    {
                        input[k] = leftArray[i];
                        i++;
                    }
                    else
                    {
                        input[k] = rightArray[j];
                        j++;
                    }
                }
            }

            private static bool IsLess(T first, T second)
            {
                return first.CompareTo(second) <= 0;
            }

            public static async Task Sort(T[] input, int left, int right)
            {
                if (left < right)
                {
                    int middle = (left + right) / 2;

                    await Sort(input, left, middle);
                    await Sort(input, middle + 1, right);

                    await Merge(input, left, middle, right);
                }
            }
        }
